import React from "react";
import Login from "./components/Login/Login"

const App = () => {
  return (
    <Login>
       <BrowserRouter></BrowserRouter>
      <Routes>
        <Route path="/AdminPage" element={<AdminPage />}></Route>
      </Routes>
    </Login>
  );
};

export default App;
